1) Kiss and Body
&quot;I am unworthy to be happy. I've always waited for someone to punish me-&quot;

Rina works at a cafe. One day, she nearly gets assaulted by a man, but she is saved by a guy named Souma Shiba, one of the regular customers at the cafe and a motorcycle road racer. Souma has to pull out of the race due to his injury from saving Rina. This incident leads Rina to start living with Souma, but then -?!

2) &quot;Who are we?- &quot;
Makato, Nahato, and Shuu are all connected by an incident that happened in the past. Makato is working is a detective working undercover to find a drug dealer in an all boys high school. Makato does not remember anything about her past and has a burn on her back, as Makato gets to know the &quot;trader&quot; she discovers he has a burn on his arm that is like a puzzel piece to Makato's burn, but he also doesn't have any recollection of his past either.

&quot;Taku-chan is my hero.&quot;

The cheerful and caring Takumasa and the quiet Ken: there's a deep reason why these two started exchanging diaries, although it may seem childish. They've been doing it for five years and now it has become their special daily routine, which connects them to each other. That's why they should've known everything about each other&hellip; but Takumasa is surprised to hear from his classmate that Ken's in love!

*There is an extra about another couple that is still untranslated.

Ritsuka, a Ryousei student, believes that she&rsquo;ll find a wonderful boyfriend by following the love legends. After all, her older sister, Aya, followed them, and she got married! Yet every time Ritsuka carries out a legend superstition, Kuze-kun gets in her way&hellip;

Although they fight all the time, Kuze-kun is always there for her when she&rsquo;s feeling scared or anxious. While his words are ill-natured, he is kind to her, so Ritsuka feels happy even when she&rsquo;s mad at him&hellip;

Ritsuka falls in love with Kuze-kun. After four of the legendary superstitions were completed, Ritsuka and Kuze-kun fell in love with each other, but&hellip;?!

