&quot;30,000 residents of the Northern Kelko plains were vaporized by the Kiyania bioweapon sprayed by the terrorist group Echiboza. 30,000 cats remained in their place. However, one person escaped this fate; a girl saved by a stranger with a gas mask.

Her name: Kaka Hollen.&quot;

In this strange new world, terrorism, crime, and corruption have found a new target in the feline kind. Enter counter-terrorism squad 'Green' and their all-purpose humanoid weapons, the 'OB's! But what role will Kaka play in midst of all this?

Just after entering university, Minato drops out to instead become the board chairman of her recently-deceased grandmother's cooking school.

The head of confectionary, Nakamura, explains to Minato the school's current position. Heeding the advice of her childhood friend and current Chinese cuisine chef Ichika-kun, Minato hires the popular Japanese cuisine chef, the handsome Akiyama, and the Italian cuisine chef, Maeda, to become lecturers at the school. The kind and gentlemanly Akiyama; the unfriendly and strict Maeda; the splendid, despite his cute exterior, Ichika; the cool and mysterious Nakamura&hellip;

Together with the four handsome chefs, Minato opens the cooking school. What will happen from here on&hellip;!?

Once upon a time, there was a god named Prometheus. He loved human beings so much that he stole the fire from the gods for them without letting other gods knew. Zeus was really irritated.

To take revenge on Prometheus and the human race, Zeus created Pandora, the very first woman ever to have absolutely ideal features. He then gave her a mysterious box and sent her down to earth. Out of curiosity, Pandora opened the box, not knowing that she has released all kinds of sins trapped in it.

Since then, human had lived in chaos. Pandora attempted to put sins back to where they are supposed to be but all in vain. She peered over the box in despair and saw one last thing left in the box - hope. Ever since then, the box had been  hidden and nowhere to be seen until that day&hellip;

